import './../App.css';
import Header from './Header';
import Layout from '../pages/Layout';
import Footer from './Footer';

function App() {
  return (
    <div className="App">
      <Header />
      <div className="wrap">
        <Layout />
        <Footer />
      </div>
    </div>
  );
}

export default App;
